import React from 'react'

function Contacttbox(props) {
    return (
        <>
            <div className="comment-box-container">
                <span><b>Name : </b>{props.data.projectname}</span>
                <span><b>Content : </b>{props.data.projectinfo}</span>
                <span><b>Content : </b>{props.data.projectaddress}</span>

                <div className="comment-box-buttons">
                    <button type='button' onClick={() => { props.setProjectFunc(props.data._id) }}>Okundu</button>
                </div>
            </div>
        </>
    )
}
export default Contacttbox;
